import React from 'react';
import { Link } from 'react-router-dom';
const Header = () => {
  return (
    <div>
      <img src="" alt="msniccki_header" />
    <div className="ui secondary pointing menu header">
      <Link to="/pages/videos" className="item">
        Videos
      </Link>
      <Link to="/pages/photos" className="item">
        Photos
      </Link>
      <Link to="/pages/music" className="item">
        Music
      </Link>
        <Link to="/pages/bio" className="item">
          Bio
        </Link>
    </div>
    </div>
  );
};

export default Header;
